import React from "react";

const img_url = "https://source.unsplash.com/random/500x500";

function ItemCard({ item }) {
  return (
    <div key={item.id}>
      <div
        className="item"
        style={{
          width: 128,
          height: 188,
          backgroundImage: `url(${item.img_url})`
        }}
      ></div>
    </div>
  );
}
export default ItemCard;
